package tk.gbl.cnn.util.image;

import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

import javax.imageio.ImageIO;
import java.awt.image.BufferedImage;
import java.io.*;

/**
 * Date: 2014/9/28
 * Time: 17:16
 *
 * @author Tian.Dong
 */
public class Image2Base64 {
  public static String getImageStr(String imgFilePath) {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
    byte[] data = null;

    // 读取图片字节数组
    try {
      InputStream in = new FileInputStream(imgFilePath);
      data = new byte[in.available()];
      in.read(data);
      in.close();
    } catch (IOException e) {
      e.printStackTrace();
    }

    // 对字节数组Base64编码
    BASE64Encoder encoder = new BASE64Encoder();
    return encoder.encode(data);// 返回Base64编码过的字节数组字符串
  }

  //base64字符串转化成图片
  public static boolean generateImage(String imgStr, String filePath) {   //对字节数组字符串进行Base64解码并生成图片
    if (imgStr == null) //图像数据为空
      return false;
    BASE64Decoder decoder = new BASE64Decoder();
    try {
      //Base64解码
      byte[] b = decoder.decodeBuffer(imgStr);
      for (int i = 0; i < b.length; ++i) {
        if (b[i] < 0) {//调整异常数据
          b[i] += 256;
        }
      }
      //生成jpeg图片
      OutputStream out = new FileOutputStream(filePath);
      out.write(b);
      out.flush();
      out.close();
      return true;
    } catch (Exception e) {
      return false;
    }
  }

  //base64字符串转化成图片
  public static BufferedImage generateImage(String imgStr) {   //对字节数组字符串进行Base64解码并生成图片
    if (imgStr == null) //图像数据为空
      return null;
    BASE64Decoder decoder = new BASE64Decoder();
    try {
      //Base64解码
      byte[] b = decoder.decodeBuffer(imgStr);
      for (int i = 0; i < b.length; ++i) {
        if (b[i] < 0) {//调整异常数据
          b[i] += 256;
        }
      }
      ByteArrayInputStream in = new ByteArrayInputStream(b);    //将b作为输入流；

      BufferedImage image = ImageIO.read(in);
      return image;
    } catch (Exception e) {
      return null;
    }
  }

  public static void main(String[] args) {
//    String base64Str = Image2Base64.getImageStr("F:\\code\\getcode.jpg");
//    System.out.println(base64Str);

    String str = "";
    Image2Base64.generateImage(str, "F:\\test222.jpg");
  }
}
